import React, { PropsWithChildren } from 'react';
import { useNavigate } from 'react-router-dom';
import { ROUTER_KEYS } from '../../../consts/app-keys.const';
import { ITodo } from '../../../types/todo.types';
import { StyledViewButton } from '../actions/view-todo.styled';
import DeleteTodo from '../actions/deleteTodo.component';
import { CompleteToggle } from '../actions/completeToggle.component';

type Props = PropsWithChildren<{
  todo: ITodo;
}>;

const TodoMobileElement = ({ todo }: Props) => {
  const navigate = useNavigate();

  const handleViewClick = () => {
    navigate(ROUTER_KEYS.TODO, { state: { todoId: todo.id } });
  };

  return (
    <div className="todo-item-mobile">
      <h2 className="title">{todo.title}</h2>
      <div className="description">{todo.description}</div>
      <div className="mobile-actions">
        <div className="mobile-actions-buttons">
          <StyledViewButton className="view-button" onClick={handleViewClick}>
            View
          </StyledViewButton>
          <DeleteTodo todoId={todo.id} />
        </div>
        <CompleteToggle todo={todo} />
      </div>
    </div>
  );
};

export default TodoMobileElement;
